import React from 'react'
import rsLogo from '../assets/rs_school_js.svg'
import gitLogo from '../assets/gitHub.png'

export const Footer = () => {
    return (
        <footer className='footer'>
            <div className='footer-images-container'>
                <a href='https://rs.school/react/'><img className='footer-rs-logo' src={rsLogo} alt=""/></a>
                <a href="https://github.com/Jears017"><img className='footer-gitHub-logo' src={gitLogo} alt=""/></a>
            </div>
        </footer>
    )
}
